PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "article_article" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(30) NOT NULL, "text" text NOT NULL, "image" varchar(100) NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "user_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(25) NOT NULL, "city" varchar(40) NOT NULL, "restaurantName" varchar(40) NOT NULL, "phone_number" varchar(128) NOT NULL UNIQUE, "password" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "rawmaterial_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rawmaterial_raw_material" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "value" bigint NOT NULL, "price" bigint NOT NULL, "category_id" bigint NOT NULL REFERENCES "rawmaterial_category" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "butchery_butchery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "useless" real NOT NULL, "used" varchar(50) NOT NULL, "weight" real NOT NULL, "usable" real NOT NULL, "cooking_loss" real NOT NULL, "totalprice" bigint NOT NULL, "created" datetime NOT NULL, "raw_press" real NOT NULL, "cooked_press" real NOT NULL, "material_id" bigint NOT NULL REFERENCES "rawmaterial_raw_material" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "cost_cost" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "condition" varchar(5) NOT NULL, "price" integer NOT NULL, "date" datetime NOT NULL, "description" varchar(250) NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "counseling_counseling" ("date" date NOT NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "condition" varchar(3) NOT NULL, "topic" varchar(20) NOT NULL, "job" varchar(10) NOT NULL, "city" varchar(10) NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "education_education" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "file" varchar(100) NOT NULL, "poster" varchar(100) NOT NULL, "description" text NOT NULL, "created" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_food" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(20) NOT NULL, "image" varchar(100) NULL, "created" datetime NOT NULL, "NumberSold" integer NOT NULL, "resepi" text NULL, "price_offered" integer NULL, "updated" date NULL, "category_id" bigint NOT NULL REFERENCES "food_category" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_preparationscategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_preparationsfood" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(20) NOT NULL, "image" varchar(100) NULL, "created" datetime NOT NULL, "NumberSold" integer NOT NULL, "resepi" text NULL, "price_offered" integer NULL, "updated" date NULL, "category_id" bigint NOT NULL REFERENCES "food_preparationscategory" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_preparationsmaterial" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" real NOT NULL, "food_id" bigint NOT NULL REFERENCES "food_preparationsfood" ("id") DEFERRABLE INITIALLY DEFERRED, "materialRaw_id" bigint NOT NULL REFERENCES "rawmaterial_raw_material" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_percentages" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "FactorcCoefficient" real NOT NULL, "productionOrService" real NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "food_material" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" real NOT NULL, "food_id" bigint NOT NULL REFERENCES "food_food" ("id") DEFERRABLE INITIALLY DEFERRED, "materialRaw_id" bigint NOT NULL REFERENCES "rawmaterial_raw_material" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "income_income" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fixedSalary" integer NOT NULL, "overTime" bigint NOT NULL, "reward" integer NOT NULL, "totalAmount" integer NOT NULL, "extra_expenses" integer NOT NULL, "Insurance" integer NOT NULL, "gift" integer NOT NULL, "employee_id" bigint NOT NULL REFERENCES "employee_employee" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "shopinglist_shopinglist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "foodStuffs" varchar(40) NOT NULL, "quantity" real NOT NULL, "price" integer NULL, "status" varchar(3) NOT NULL, "date" datetime NOT NULL, "factorImage" varchar(100) NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "story_story" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "file" varchar(200) NOT NULL, "poseter" varchar(200) NOT NULL, "name" varchar(20) NOT NULL, "created" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "subscription_pakage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(20) NOT NULL, "description" text NOT NULL, "price" bigint NOT NULL, "discount" integer NOT NULL, "created" date NOT NULL, "updated" date NOT NULL);
CREATE TABLE IF NOT EXISTS "subscription_buy" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "time" integer NOT NULL, "created" date NOT NULL, "pakage_id" bigint NOT NULL REFERENCES "subscription_pakage" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "ticket_ticket" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "message" text NOT NULL, "status" varchar(50) NOT NULL, "created" datetime NOT NULL, "answerdTime" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "user_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "ticket_ticketreply" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "message" text NOT NULL, "created" datetime NOT NULL, "ticket_id" bigint NOT NULL REFERENCES "ticket_ticket" ("id") DEFERRABLE INITIALLY DEFERRED);
